public class InnerGraphQLApiAdditionalAuthenticationProviderFactory(Action<Humidifier.AppSync.GraphQLApiTypes.AdditionalAuthenticationProvider> factoryAction = null) : SubResourceFactory<Humidifier.AppSync.GraphQLApiTypes.AdditionalAuthenticationProvider>
{

    internal InnerGraphQLApiOpenIDConnectConfigFactory OpenIDConnectConfigFactory { get; set; }

    internal InnerGraphQLApiLambdaAuthorizerConfigFactory LambdaAuthorizerConfigFactory { get; set; }

    internal InnerGraphQLApiCognitoUserPoolConfigFactory UserPoolConfigFactory { get; set; }

    protected override Humidifier.AppSync.GraphQLApiTypes.AdditionalAuthenticationProvider Create()
    {
        var additionalAuthenticationProviderResult = CreateAdditionalAuthenticationProvider();
        factoryAction?.Invoke(additionalAuthenticationProviderResult);

        return additionalAuthenticationProviderResult;
    }

    private Humidifier.AppSync.GraphQLApiTypes.AdditionalAuthenticationProvider CreateAdditionalAuthenticationProvider()
    {
        var additionalAuthenticationProviderResult = new Humidifier.AppSync.GraphQLApiTypes.AdditionalAuthenticationProvider();

        return additionalAuthenticationProviderResult;
    }
    public override void CreateChildren(Humidifier.AppSync.GraphQLApiTypes.AdditionalAuthenticationProvider result)
    {
        base.CreateChildren(result);

        result.OpenIDConnectConfig ??= OpenIDConnectConfigFactory?.Build();
        result.LambdaAuthorizerConfig ??= LambdaAuthorizerConfigFactory?.Build();
        result.UserPoolConfig ??= UserPoolConfigFactory?.Build();
    }

} // End Of Class

